import React from "react";
import { Breadcrumb } from 'react-bootstrap';

function Weeks(props) {

    // console.log('inside weeks!')
    return (
            <Breadcrumb.Item onClick={() => props.handleClick('week', props.week)}>
                Week {props.week} (hi)
            </Breadcrumb.Item>
    )


}

export default Weeks;
